import React, { useState, useEffect } from 'react';
import axios from 'axios';
import QuestionsList from './QuestionsList';

const UserDashboard = () => {
  const [bookmarkedQuestions, setBookmarkedQuestions] = useState([]);

  useEffect(() => {
    const fetchBookmarks = async () => {
      try {
        const userId = localStorage.getItem('userId');
        const token = localStorage.getItem('token');
        const response = await axios.get(`http://localhost:5208/api/bookmarks/${userId}`, {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        setBookmarkedQuestions(response.data);
      } catch (error) {
        console.error('Error fetching bookmarks:', error);
      }
    };

    fetchBookmarks();
  }, []);

  return (
    <div>
      <h1>Bookmarked Questions</h1>
      {bookmarkedQuestions.length > 0 ? (
        <QuestionsList questionsData={bookmarkedQuestions} />
      ) : (
        <p>No bookmarked questions available.</p>
      )}
    </div>
  );
};

export default UserDashboard;
